import React, { useState } from 'react';
// import Student from './Student';

const App = () => {

  const [data,setdata]=useState("");

  const getdata=(e)=>{
    setdata(e.target.value)
  }

  const submit=(e)=>{
    setdata(data);
    setdata("");
    e.preventDefault();
  }

  return (
  <>


<input type="text" onChange={getdata}  value={data}/>
<button onClick={submit}>click</button>
<h1> {data}</h1>
  </>
    );
};

export default App;
